sentence:
the printer I purchased constantly went off line; it would take at least half a day of my time to find out how to get the printer to work; 
at one time I had a IT rep from HP access my computer to get it back online and working; the colour ink would not work I was instructed to insert a black ink cartridge;
I have used approximately 30 pages of paper to print out the printer info sheet; which only stated the printer was "offline" and yes I had checked my computer settings and the printer was set up as the default printer as well my wifi was turned on; all the required settings on my system were on. 
To date the printer is sitting here doing nothing; even to scan a document takes a lot of time checking all settings to get the machine to scan ; 
unfortunately I missed the window of opportunity to return this thing for a full refund.
Needless to say the project I had intended to complete last year is left unfinished; my time was used up with constant hours of getting this printer online to be able to use it. For now I have to use a "printer service" at a local vendor or the library; not very convenient if one has a large project; as well the hours of operation are limited. 
I am extremely unhappy with Hewlitt Packard as a whole. I had been considering a new computer and other items; but if this printer is an example of the quality of HP merchandise I will not purchase any other Hewlitt Packard product in the future.
